const multer = require('multer');
const path = require('path');
const readExcelFile = require('read-excel-file/node');
const mongoose = require('mongoose');
const fs = require('fs');

// Ensure uploads directory exists
const uploadDir = path.join(__dirname, '..', 'uploads');
if (!fs.existsSync(uploadDir)) {
    fs.mkdirSync(uploadDir);
}

const storage = multer.diskStorage({
    destination: function(req, file, cb) {
        cb(null, 'uploads/');
    },
    filename: function(req, file, cb) {
        cb(null, file.fieldname + '-' + Date.now() + path.extname(file.originalname));
    }
});

const upload = multer({ storage: storage }).single('file');

exports.handleFileUpload = async (req, res) => {
    upload(req, res, async function(err) {
        const { examName, year, round } = req.body;

        if (!examName || !year || !round) {
            return res.status(400).send({ message: 'examName, year, and round are required.' });
        }

        if (err instanceof multer.MulterError || err) {
            return res.status(500).send({ message: err.message });
        }

        const collectionName = `${examName}_${year}_Round${round}`;
        const schema = new mongoose.Schema({}, { strict: false });
        const DynamicModel = mongoose.model(collectionName, schema, collectionName);

        // Delete existing data if it exists
        await DynamicModel.deleteMany({});

        const filePath = path.join(__dirname, '..', 'uploads', req.file.filename);
        readExcelFile(filePath).then(async rows => {
            rows.shift();  // Assuming first row is header
            const results = rows.map(row => ({
                rank: row[1],
                allottedQuota: row[2],
                allottedInstitute: row[3],
                course: row[4],
                allottedCategory: row[5],
                candidateCategory: row[6],
                examName: examName,
                year: year,
                round: round
            }));

            try {
                await DynamicModel.insertMany(results);
                res.send('Data has been successfully saved to MongoDB.');
            } catch (err) {
                console.error('MongoDB insertion error:', err);
                res.status(500).send('Failed to insert data into MongoDB');
            }
        }).catch(err => {
            console.error('Error reading Excel file:', err);
            res.status(500).send('Failed to process file');
        });
    });
};

exports.uploadCourseDetails = async (req, res) => {
    upload(req, res, async function(err) {
        if (err instanceof multer.MulterError || err) {
            return res.status(500).send({ message: err.message });
        }

        const filePath = path.join(__dirname, '..', 'uploads', req.file.filename);
        readExcelFile(filePath).then(async rows => {
            rows.shift();  // Assuming first row is header
            const courses = rows.map(row => ({
                course: row[0],
                courseCode: row[1],
                duration: row[2],
                courseCategory: row[3],
                courseType: row[4],
                degreeType: row[5],
                description: row[6]
            }));

            try {
                const CourseModel = mongoose.model('Course', new mongoose.Schema({}, { strict: false }), 'courses');
                await CourseModel.deleteMany({});
                await CourseModel.insertMany(courses);
                res.send('Course information has been successfully saved to MongoDB.');
            } catch (err) {
                console.error('MongoDB insertion error:', err);
                res.status(500).send('Failed to insert course information into MongoDB');
            }
        }).catch(err => {
            console.error('Error reading Excel file:', err);
            res.status(500).send('Failed to process file');
        });
    });
};

exports.listAvailableDataSets = async (req, res) => {
    try {
        const { examName, year } = req.query;

        if (!examName || !year) {
            return res.status(400).send({ message: 'examName and year are required.' });
        }

        // Dynamically find all rounds for the exam and year
        const collections = await mongoose.connection.db.listCollections().toArray();
        const availableDataSets = collections
            .map(collection => collection.name)
            .filter(name => name.startsWith(`${examName}_${year}_Round`));

        res.json({ availableDataSets });
    } catch (err) {
        console.error('Error listing available data sets:', err);
        res.status(500).send('Failed to list available data sets.');
    }
};

exports.generateCombinedResults = async (req, res) => {
    try {
        const { examName, resultName, year, selectedDataSets } = req.body;

        if (!examName || !resultName || !year || !selectedDataSets || selectedDataSets.length === 0) {
            return res.status(400).send({ message: 'examName, resultName, year, and selectedDataSets are required.' });
        }

        const combinedCollectionName = `${examName}_${resultName}`;
        const schema = new mongoose.Schema({}, { strict: false });
        const CombinedModel = mongoose.model(combinedCollectionName, schema, combinedCollectionName);

        await CombinedModel.deleteMany({});

        const CourseModel = mongoose.model('Course', new mongoose.Schema({}, { strict: false }), 'courses');
        const courses = await CourseModel.find({}).lean();

        const courseMap = courses.reduce((acc, course) => {
            acc[course.course] = course;
            return acc;
        }, {});

        for (const dataSet of selectedDataSets) {
            const RoundModel = mongoose.model(dataSet, schema, dataSet);
            const roundData = await RoundModel.find({}).lean();

            const enrichedData = roundData.map(data => {
                const courseDetails = courseMap[data.course] || {};
                return { ...data, ...courseDetails };
            });

            await CombinedModel.insertMany(enrichedData);
        }

        res.send('Combined results with course details have been successfully generated and saved.');
    } catch (err) {
        console.error('Error generating combined results:', err);
        res.status(500).send('Failed to generate combined results.');
    }
};

